import React from 'react'
import { Box, TextField } from '@mui/material'

function Contact() {
  return (
    <Box
    component="form"
    sx={{
      '& .MuiTextField-root': { m: 1, width: '25ch' },
      bgColor:"10px"
    }}
    noValidate
    autoComplete="off"
  >
    <div>
      <TextField
        id="outlined-multiline-flexible"
        label="Multiline"
        multiline
        maxRows={4}
      />
      </div>
      </Box>
  )
}

export default Contact
